import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const Fullpage = (props) => {
    // Access the props passed from the previous component
    const location = useLocation();
    const navigate = useNavigate();
    const { prop1, prop2, prop3 } = location.state;


    const navigateToWeatherPage = () => {
        // Use history.push to navigate to the fullweatherpage route
        navigate("/weather");
      };

    return (
        <div>
            <div>This is a test</div>
            <p>{prop1}</p>
            <p>{prop2}</p>
            <p>{prop3}</p>
            <button onClick={navigateToWeatherPage}>Back</button>
        </div>
    );
}

export default Fullpage;
